    [],nt"revision_timestamp": "2016-03-28T18:44:12.296114",nt"name": "sea-turtle-interaction-report",nt"isopen":
    false,nt"url": null,nt"notes": "The Sea Turtle Interaction Report is a
    report sent out in pdf format to authorized individuals that summarizes sea turtle
    interactions in the longline fishery. The report is broken down by specific fishery
    such as deep set, shallow set and American Samoa and list certain details of every
    sea turtle interactions. There are two types of reports that are generated and referred
    to as 2(b) and 2(d). The 2(b) report is sent out whenever an unconfirmed sea turtle
    interaction has been called in by an observer out at sea. The 2(d) report is sent
    out on or around the the 1st and the 15th of every month.",nt"license_title":
